import './App.css';
import image from './Image/profile.jpg';

function App() {
  return (
    <div className="App">
      <h1>I'm Rahul</h1>
      <p>I am graduate in 2019 in computer science and engineering from krishna institutte of technology</p>
      <img src={image} width='50%' height="100%" alt='profile'></img>
    </div>
  );
}

export default App;
